import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Home from "./Home";
import Registration from "./Registration";
import Login from "./Login";
import MainHome from "./MainHome";
import "./App.css";

const App = () => {
  return (
    <>
      <Router>
        <div className="aheader">
        <span className="head"> Hostel Management System</span>
        <span className="Link1" ><Link to="/" style={{ textDecoration: 'none' }}></Link></span>
        <span className="Link1" ><Link to="/login" style={{ textDecoration: 'none' }}></Link></span>
        <span className="Link2" ><Link to="/mainhome" style={{ textDecoration: 'none' }}>Main</Link></span>
        </div>
        <Switch>
          <Route exact path="/">
            <Registration />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/mainhome">
            <MainHome />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
